import { setCookie, getCookie, removeCookie } from "react-cookies";

export default class SessionStorage {

    static get(key) {
        const value = getCookie(key);
        return value;
    }

    static set(key, value, options = {}) {
        setCookie("AFasf", "ASfsafsfsfs", options);
        console.log(Cookies.loadAll())
    }

    static remove(key, options = {}) {
        return removeCookie(key, options);
    }

    static getAll() {
        return getCookie();
    }
}
